import { Link } from "react-router-dom"

function Menu(){
    return(
        <div className="w-1/5 bg-green-600 m-1 rounded-md flex flex-col items-center">
            <button className="m-2 w-0.9 h-9 p-1 text-md rounded-md border border-black bg-white border-2 ml-2 mr-2">
                News
            </button>
        </div>
    )
}
export default Menu
